import React, { Fragment } from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;
  //   display:flex;
`;

const SearchFormFields = [
  {
    type: "text",
    name: "min",
    placeholder: "Min",
    label: "Amount",
  },
  {
    type: "text",
    name: "max",
    placeholder: "Max",
    label: "Amount",
  },
  {
    type: "text",
    name: "binNumber",
    placeholder: "Bin Num",
    label: "BIN Number",
  },
  {
    type: "email",
    name: "email",
    placeholder: "Email",
    label: "Email",
  },
];

export const FormGroup = styled.div``;
export const FormDesc = styled.h3`
  color: #888;
  margin-bottom:1rem;
`;

export const Input = styled.input`
  padding: 0.4rem 3rem 0.4rem 0.8rem;
  font-size: 1rem;
  font-weight: 300;
  border: 1px solid #ccc;
  border-radius: 25px;
  width: 100px;
`;

const SecondSearchRow = styled.form`
  display: flex;
`;

const Wrapper = styled.div`
display:flex;
flex-direction:column;
margin: 0 2rem;
`;

const Search = () => {
  return (
    <Container>
      <SecondSearchRow>
        {SearchFormFields.map((formField, index) => {
          const { type, name, placeholder, label } = formField;
          return (
            <Wrapper key={index}>
              <FormDesc>{label}</FormDesc>
              <FormGroup>
                <Input
                  type={type}
                  name={name}
                  //   onChange={(e) => onChange(e)}
                  placeholder={placeholder}
                  //   value={formData[name]}
                />
              </FormGroup>
            </Wrapper>
          );
        })}
        {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
      </SecondSearchRow>
    </Container>
  );
};

export default Search;
